@Walshhh 

```typescript
import { getServerTRPCClient } from "@next/app/_trpc/serverTRPCClient";

export default async function Page({
  params,
}: {
  params: { organizationSlug: string };
}) {
  const tRPCClient = getServerTRPCClient();

  const getPostData = await tRPCClient.post.all.query();

  return <>{getPostData}</>;
}
```

Not sure if you are messing with tRPC + Next, but I set up a server TRPC client to call tRPC routes in server components, this is how you would use it.

